//! Generated crate containing the image ID and ELF binary of the build guest.
#[rustfmt::skip]
mod methods;
pub use methods::*;

#[cfg(test)]
mod tests {
    use super::*;
    use dcap_quote_verifier::verifier::VerifiedOutput;
    use risc0_zkvm::{ExecutorEnv, LocalProver, Prover, ProverOpts, VerifierContext};

    #[test]
    fn test_prove() {
        let quote = hex::decode("").unwrap();
        let collaterals = hex::decode("").unwrap();
        let current_time = 1738495523u64;

        if std::env::var("RISC0_DEV_MODE").is_err() {
            std::env::set_var("RISC0_DEV_MODE", "1");
        }

        let env = ExecutorEnv::builder()
            .write(&(quote, collaterals, current_time))
            .unwrap()
            .build()
            .unwrap();

        let prover = LocalProver::new("test");
        let res = prover.prove_with_ctx(
            env,
            &VerifierContext::default(),
            DCAP_QUOTE_VERIFIER_ELF,
            &ProverOpts::groth16(),
        );
        assert!(res.is_ok(), "Prover failed: {:?}", res.err().unwrap());
        let res = res.unwrap();
        println!("proving stats: {:?}", res.stats);

        let res = VerifiedOutput::from_bytes(&res.receipt.journal.bytes);
        assert!(res.is_ok(), "Verifier failed: {:?}", res.err().unwrap());
        println!("verifier output: {:?}", res.unwrap());
    }
}
